query:
query container ( $containerSearchInput:ContainerSearchInput! $ipAddressRangeContainerSearchInput:IpAddressRangeContainerSearchInput! $ipAddressRangeContainerSearchIpAddressRangeInput:IpAddressRangeContainerSearchIpAddressRangeInput! $downloadIpAddressRangeContainerFileInput:DownloadIpAddressRangeContainerFileInput! $fqdnContainerSearchInput:FqdnContainerSearchInput! $fqdnContainerSearchFqdnInput:FqdnContainerSearchFqdnInput! $downloadFqdnContainerFileInput:DownloadFqdnContainerFileInput! ) {
	container ( ) {
		list ( input:$containerSearchInput  )  {
			containersContainerSearchPayload: containers {
				id
				name
				description
				size
				auditContainer: audit {
					createdBy
					lastModifiedBy
					lastModifiedAt
					createdAt
				}

				... on FqdnContainer {
					fqdnContainerId: id
					fqdnContainerName: name
					fqdnContainerDescription: description
					fqdnContainerSize: size
					containerAudit: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}

				}
				... on IpAddressRangeContainer {
					ipAddressRangeContainerId: id
					ipAddressRangeContainerName: name
					ipAddressRangeContainerDescription: description
					ipAddressRangeContainerSize: size
					containerAudit: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}

				}
			}
		}

		ipAddressRange {
			searchIpAddressRangeContainerQueries: search ( input:$ipAddressRangeContainerSearchInput   ) {
				containerIpAddressRangeContainerSearchPayload: container {
					id
					name
					description
					size
					auditIpAddressRangeContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
			searchIpAddressRangeIpAddressRangeContainerQueries: searchIpAddressRange ( input:$ipAddressRangeContainerSearchIpAddressRangeInput   ) {
				containersIpAddressRangeContainerSearchIpAddressRangePayload: containers {
					id
					name
					description
					size
					auditIpAddressRangeContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
			downloadFileIpAddressRangeContainerQueries: downloadFile ( input:$downloadIpAddressRangeContainerFileInput   ) {
				id
				name
				encodedFile
			}
		}

		fqdn {
			searchFqdnContainerQueries: search ( input:$fqdnContainerSearchInput   ) {
				containerFqdnContainerSearchPayload: container {
					id
					name
					description
					size
					auditFqdnContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
			searchFqdnFqdnContainerQueries: searchFqdn ( input:$fqdnContainerSearchFqdnInput   ) {
				containersFqdnContainerSearchFqdnPayload: containers {
					id
					name
					description
					size
					auditFqdnContainer: audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}

			}
			downloadFileFqdnContainerQueries: downloadFile ( input:$downloadFqdnContainerFileInput   ) {
				id
				name
				encodedFile
			}
		}

	}	
}
